extension MockNetworkManager: NetworkManagerProtocol {
    
    
    
    func getDataAll<T>(route: Route, method: HTTPMethod, params: Parameters?, encoding: ParameterEncoding, headers: HTTPHeaders?, completion: @escaping (T?, Error?) -> ()) where T : Decodable {
        var data : Data?
        switch T.self{
        case is ResultsResult.Type:
            data = Data(mockResults.utf8)
        case is EventsResult.Type:
            data = Data(mockResults.utf8)
        default:
            data = Data(mockResultsTeams.utf8)
        }
        
     
 
                do {
                    let response = try JSONDecoder().decode(T.self, from: data!)
                    completion( response, nil )
                } catch let decodingError {
                    completion(nil, decodingError)
                }
 
    }
    
    
    

    
